  "TwgdEucxcHloc4cX": "let choice1 = [\r\n    {\r\n        type : \"armour\",\r\n        name : \"Nogawice kolcze\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Kolczuga\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Czepiec kolczy\"\r\n    },\r\n]\r\nlet choice2 = [\r\n    {\r\n        type : \"armour\",\r\n        name : \"Nogawice kolcze\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Kolczuga\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Czepiec kolczy\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Skórzane nogawice\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Skórzany hełm\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Skórzana kurta\"\r\n    },\r\n]\r\nlet choice3 = [\r\n    {\r\n        type : \"armour\",\r\n        name : \"Płytowy Napierśnik\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Płytowe Naramienniki\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Hełm płytowy\"\r\n    },\r\n    {\r\n        type : \"armour\",\r\n        name : \"Płytowe Nagolenniki\"\r\n    },\r\n]\r\n\r\nlet choice = await new Promise((resolve, reject) => {\r\n    new Dialog({\r\n        title : \"Wybór zbroi\",\r\n        content : \r\n        `<p>\r\n        Wybierz\r\n        </p>\r\n        <ol>\r\n        <li>Kolczuga</li>\r\n        <li>Kolczuga i skóra</li>\r\n        <li>Płyta</li>\r\n        </ol> \r\n        `,\r\n        buttons : {\r\n            1 : {\r\n                label : \"Kolczuga\",\r\n                callback : () => {\r\n                    resolve(choice1)\r\n                }\r\n            },\r\n            2 : {\r\n                label : \"Kolczuga i skóra\",\r\n                callback : () => {\r\n                    resolve(choice2)\r\n                }\r\n            },\r\n            3 : {\r\n                label : \"Płyta\",\r\n                callback : () => {\r\n                    resolve(choice3)\r\n                }\r\n            }\r\n        }\r\n    }).render(true)\r\n}) \r\n\r\nlet updateObj = this.actor.toObject();\r\nlet items = []\r\nfor (let c of choice)\r\n{\r\n    let existing \r\n    if (c.type == \"skill\")\r\n    {\r\n        existing = updateObj.items.find(i => i.name == c.name && i.type == c.type)\r\n        if (existing && c.diff?.system?.advances?.value)\r\n        {\r\n            existing.system.advances.value += c.diff.system.advances.value\r\n        }\r\n    }\r\n\r\n    if (!existing)\r\n    {\r\n        let item = await game.wfrp4e.utility.find(c.name, c.type)\r\n        if (item)\r\n        {\r\n            let equip = item.system.tags.has(\"equippable\");\r\n            item = item.toObject()\r\n            if (equip)\r\n            {\r\n                item.system.equipped.value = true;\r\n            }\r\n            items.push(foundry.utils.mergeObject(item, (c.diff || {})))\r\n        }\r\n        else\r\n            ui.notifications.warn(`Could not find ${c.name}`, {permanent : true})\r\n    }\r\n\r\n}\r\nawait this.actor.update(updateObj)\r\nthis.actor.createEmbeddedDocuments(\"Item\", items);\r\n",
