  "vejhfB9aI58iF1vr": "let choice1 = [\n    {\n        type: \"trait\",\n        name: \"Disease\",\n    },\n    {\n        type: \"trait\",\n        name: \"Infected\",\n    },\n    {\n        type: \"trait\",\n        name: \"Distracting\",\n    },\n    {\n        type: \"trait\",\n        name: \"Infestation\",\n    },\n    {\n        type: \"trait\",\n        name: \"Territorial\",\n    }\n]\n\nlet updateObj;\nlet actor;\n\nasync function addTrait(c) {\n    let items = [];\n    console.log(\"TEST1\", c);\n    let existing;\n    if (c.type == \"trait\") {\n        existing = updateObj.items.find(i => i.name == c.name && i.type == c.type);\n    }\n    console.log(\"TEST\", existing);\n    if (!existing) {\n        let item = await game.wfrp4e.utility.find(c.name, c.type);\n        if (item) {\n            item = item.toObject();\n            items.push(item);\n        }\n        else\n            ui.notifications.warn(`Could not find ${c}`, { permanent: true });\n    }\n    console.log(\"WISH LIST2\", choice1, items);\n    actor.createEmbeddedDocuments(\"Item\", items);\n}\n\nasync function dialogChoice() {\n    for (let c of choice1) {\n        await new Dialog({\n            title: \"Option\",\n            content:\n                `<p>\n            Add Option?\n            </p>\n            <ol>\n            <li>${c.name}</li>\n            </ol> \n            `,\n            buttons: {\n                1: {\n                    label: \"Yes\",\n                    callback: () => {\n                        addTrait(c)\n                        c.valid = true;\n                    }\n                },\n                2: {\n                    label: \"No\",\n                    callback: () => {\n                    }\n                }\n            }\n        }).render(true)\n    }\n}\n\nupdateObj = this.actor.toObject();\nactor = this.actor\nawait dialogChoice();\n\n",
