  "z5HfNUrHy5MS3K7a": "let test = await this.actor.setupSkill(game.i18n.localize(\"NAME.Cool\"), {skipTargets: true, appendTitle :  ` - ${this.effect.name}`, context : {failure: \"Dodatkowy Punkt Zepsucia\"}})\r\nawait test.roll();\r\nif (test.failed && this.actor.type == \"character\")\r\n{\r\n    this.actor.update({\"system.status.corruption.value\" : parseInt(this.actor.status.corruption.value) + 1})\r\n    this.script.message(\"Otrzymano Punkt Zepsucia\", {whisper : ChatMessage.getWhisperRecipients(\"GM\")})\r\n}",
  "Z6jNlyZMECkW4Hon": "let spells = await warhammer.utility.findAllItems(\"spell\", \"Wczytuję Zaklęcia...\", true);\r\n\r\nlet choice = await ItemDialog.create(spells, 1);\r\n\r\nif (choice[0])\r\n{\r\n    this.script.message(`Wybrano @UUID[${choice[0].uuid}]{${choice[0].name}}`)\r\n    let spell = (await fromUuid(choice[0].uuid)).toObject(); // Might be an index so retrieve item object for sure\r\n    setProperty(spell, \"flags.wfrp4e.boonOfTzeentch\", true);\r\n    spell.system.wind.value = \"Splatanie Magii (Dhar)\";\r\n    spell.system.memorized.value = true;\r\n    this.actor.createEmbeddedDocuments(\"Item\", [spell], {fromEffect: this.effect.id})\r\n}",
  "Z6OmmC0irJzxSnMH": "let chatData = { whisper: ChatMessage.getWhisperRecipients(\"GM\") }\r\nlet message = \"\"\r\n\r\nlet wounds = foundry.utils.duplicate(this.actor.status.wounds)\r\nlet regenRoll = await new Roll(\"1d10\").roll();\r\nlet regen = regenRoll.total;\r\n\r\nif (wounds.value >= wounds.max)\r\n    return\r\n\r\nif (wounds.value > 0) \r\n{\r\n    wounds.value += regen\r\n    if (wounds.value > wounds.max)\r\n    {\r\n        wounds.value = wounds.max\r\n    }\r\n    message += `<b>${this.actor.name}</b>: Odzyskane punkty Żywotności: ${regen}.`\r\n\r\n    if (regen == 10)\r\n    {\r\n        message += `<br>Dodatkowo zregenerowano krytyczną ranę.`\r\n    }\r\n}\r\nelse if (regen >= 8) \r\n{\r\n    message += `<b>${this.actor.name}</b>: wylosowano ${regen} i odzyskano 1 punkt Żywotności.`\r\n    wounds.value += 1\r\n    if (regen == 10)\r\n    {\r\n        message += `<br>Dodatkowo zregenerowano krytyczną ranę.`\r\n    }\r\n}\r\nelse \r\n{\r\n    message += `<b>${this.actor.name}</b>: wylosowano ${regen} - brak efektu.`\r\n}\r\n\r\nawait this.actor.update({ \"system.status.wounds\": wounds })\r\nthis.script.message(message, { whisper: ChatMessage.getWhisperRecipients(\"GM\") })\r\n\r\nif (this.actor.Species != \"Ogr\")\r\n{\r\n   this.actor.setupSkill(game.i18n.localize(\"NAME.Endurance\"), {skipTargets: true, appendTitle :  \" - \" + this.effect.name, fields : {difficulty : \"average\"}}).then(test => {\r\n       test.roll()\r\n   })\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n",
  "z8mwLihZQu0JtUHY": "\nlet characteristics = {\n    \"ws\" : 20,\n    \"bs\" : 20,\n    \"s\" : 0,\n    \"t\" : 20,\n    \"i\" : 30,\n    \"ag\" : 0,\n    \"dex\" : 10,\n    \"int\" : 65,\n    \"wp\" : 70,\n    \"fel\" : 20\n}\nlet skills = [\"Channelling\", \"Cool\", \"Intimidate\", \"Language (Magick)\", \"Language (Nehekharan)\", \"Leadership\", \"Lore (Magic)\", \"Perception\"]\nlet skillAdvancements = [20, 30, 25, 30, 20, 20, 30, 20]\nlet talents = [\"Aethyric Attunement\", \"Arcane Magic\", \"Hardy\", \"Instinctive Diction\", \"Magical Sense\", \"Menacing\", \"Menacing\", \"Petty Magic\", \"Read/Write\", \"Second Sight\", \"War Wizard\"]\nlet trappings = [\"Hand Weapon\"]\nlet specialItems = [ \n    {name: \"Mouldering Robes\", type: \"trapping\", trappingType: \"clothingAccessories\" }, \n    {name: \"Pouches containing ritual components\", type: \"trapping\", trappingType: \"clothingAccessories\" }, \n    {name: \"Staff\", type: \"weapon\", damage: \"SB+2\"}, \n    {name: \"Dark Magic (Necromancy)\", type: \"talent\"},\n]    \nlet items = [];\n\nlet updateObj = this.actor.toObject();\n\nfor (let ch in characteristics)\n{\n    updateObj.system.characteristics[ch].modifier += characteristics[ch];\n}\n\nfor (let item of specialItems) {\n    let newItem\n    if (item.type == \"weapon\") {\n        newItem = new ItemWfrp4e({ name: item.name, type: item.type, system: { equipped: true, damage: {value: item.damage}}  })\n    } else if (item.type == \"trapping\") {\n        newItem = new ItemWfrp4e({ img: \"systems/wfrp4e/icons/blank.png\", name: item.name, type: item.type, system: { worn: true, trappingType: { value: item.trappingType}  } } )\n    } else {\n        newItem = new ItemWfrp4e({ img: \"systems/wfrp4e/icons/blank.png\", name: item.name, type: item.type  })\n    }\n    items.push(newItem.toObject())\n}\n\nfor (let index = 0; index < skills.length; index++)\n{\n    let skill = skills[index]\n    let skillItem;\n    skillItem = updateObj.items.find(i => i.name == skill && i.type == \"skill\")\n    if (skillItem)\n        skillItem.system.advances.value += skillAdvancements[index]\n    else \n    {\n        skillItem = await game.wfrp4e.utility.findSkill(skill)\n        skillItem = skillItem.toObject();\n        skillItem.system.advances.value = skillAdvancements[index];\n        items.push(skillItem);\n    }\n}\n\nfor (let talent of talents)\n{\n    let talentItem = await game.wfrp4e.utility.findTalent(talent)\n    if (talentItem)\n    {\n        items.push(talentItem.toObject());\n    }\n    else \n    {\n        ui.notifications.warn(`Could not find ${talent}`, {permanent : true})\n    }\n}\n\nfor (let trapping of trappings) \n{\n    let trappingItem = await game.wfrp4e.utility.findItem(trapping)\n    if (trappingItem)\n    {\n        trappingItem = trappingItem.toObject()\n\n        trappingItem.system.equipped.value = true;\n\n        items.push(trappingItem);\n    }\n    else \n    {\n        ui.notifications.warn(`Could not find ${trapping}`, {permanent : true})\n    }\n}\n\nupdateObj.name = updateObj.name += \" \" + this.effect.name\n\nawait this.actor.update(updateObj)\nconsole.log(\">>>>>>><\", items)\nthis.actor.createEmbeddedDocuments(\"Item\", items);\n",
